import { Link } from "react-router-dom";
import "./index.css";

function Header() {
  return (
    <div className="kasa-header">
      <img
        className="kasa-header-logo"
        src="../../public/assets/logo_header_kasa.png"
        alt="Logo"
      />
      <nav className="kasa-header-lien">
        <Link to="/">Accueil</Link>
        <Link to="/survey">A propos</Link>
      </nav>
    </div>
  );
}

export default Header;
